import React from 'react';
import './App.css';
import Nav from './Nav';
import About from './About';
import Signin from './Signin';
import Signup from './Signup';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <Nav />
      <About />
      <Route path="/Signin" component={Signin} />
    </div>
    </Router>
  );
}

export default App;
